description:
In anticipation of VGHS Season 3.

Each season has been cut into a single &quot;seamless&quot; file with opening and closing credits removed between episodes.

I'm not completely happy with some of the cuts between episodes but all-in-all it works really well. Also, The footage may or may not be true 1080p xD






